        <div className="btn"><img className="btn" src="" alt="" /></div>
        <div className="btn"><img className="btn" src="" alt="" /></div>
        <div className="btn"><img className="btn" src="" alt="" /></div>

      </div>
    </>
  );
};

export default Skills;
